        data.forEach(function(d){

            d.Year = d.date.getFullYear();
        });

        var dateDim = ndx.dimension(function(d){

        });

        var prices = dateDim.group().reduceSum(function(d){
            return d.price;
        });

            return d.Year;
        });

            return d.price;
        });

        var minDate = dateDim.bottom(1)[0].date;
        var maxDate = dateDim.top(1)[0].date;

        var dailyAverageLineChart = dc.lineChart("#chart­line­daily-average");

                .width(500)
                .height(200)
                .dimension(dateDim)
                .group(prices)
                .x(d3.time.scale().domain([minDate,maxDate]));


        var hitspieChart = dc.pieChart("#chart­ring-year");

        hitspieChart
                .width(190)
                .height(190)
                .slicesCap(4)
                .innerRadius(50)
                .dimension(yearDim)
                .group(year_total);
